import React from "react";
import { Link } from "react-router-dom";
const Listmov = ({ props }) => {
  return (
    <div>
      {props.map((movies, i) => {
        return (
          <div key={i}>
            <Link to={`/movies/${movies.imdbID}`}>
              <img src={movies.Poster} alt={movies.Title} />
            </Link>
          </div>
        );
      })}
    </div>
  );
};

export default Listmov;
